  true,\n\t\"url\": null,\n\t\"notes\": \"The Foods and Physical Activity in Public
  Elementary Schools, 2005 (FRSS 87), is a study that is part of the Fast Response
  Survey System (FRSS) program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
  FRSS 87 (http://nces.ed.gov/surveys/frss/) is a sample survey that was designed
  to obtain current national information on availability of foods and opportunities
  for exercise in public elementary schools. Questionnaires were mailed to the principals
  of each sampled school.  Respondents had the option of completing paper-and-pencil
  or web-based questionnaires. The study's weighted response rate was 91 percent.
  Key statistics produced from the study were  types of food sold at one or more locations
  in their schools and in their cafeterias or lunchrooms; the types of food sold at
  vending machines and school stores or snack bars, and times when foods were available
  at those locations; food service operations and contracts with companies to sell
  foods at schools; scheduled recess, including the days per week, times per day,
  and minutes per day of recess; scheduled physical education, including the days
  per week, class length, and average minutes per week of physical education; activities
  to encourage physical activity among elementary students; and the physical assessment
  of students.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
